function addObsTable($tableName, $database){

    	$createQuery = "CREATE TABLE ".$tableName."
						(
						`Field01` bigint(20) NOT NULL auto_increment,
						`Field02` date NOT NULL, 
						`Field03` time NOT NULL, 
						`Field04` int, 
						`Field05` int, 
						`Field06` text, 
						`Field07` float(1), 
						`Field08` int, 
						`Field09` int, 
						`Field10` int, 
						`Field11` text, 
						`Field12` float(1), 
						`Field13` int, 
						`Field14` text, 
						`Field15` text, 
						`Field16` text, 
						`Field17` text, 
						`Field18` text,
						`Field19` int,
						PRIMARY KEY (`Field01`)
						)";
    	
    	$database->query($createQuery);
		
		// Attempt execution
		// If successful
		if($database->execute()){
			echo 'Table added';
		}else{
			echo 'Failed to add table';
		}
    }

function addPatientData($hosNum){
	global $patId, $consultant, $gender, $patientObsData;
	$id=getPatId($patId);
			$firstName = "Test".$patId;
			$lastName = "Data".$patId;
