			$time = $patientObsData[0]["time"];
			$add=getAddmissionTime($date, $time);
			$tableName="CT".$patId;
			$dob=getDOB();
			$address= $patId." Example Street, Some District, Somecity, Somecounty, T1 1AA";
			$currentPatId="00".$id;
			
			$database=new Database();
			$insertQuery = "INSERT INTO `CH013`
						(`Field01`, `Field02`, `Field03`, `Field04`, `Field05`, 
						`Field06`, `Field07`, `Field08`, `Field09`) VALUES 
						('".$id."', '".$nhsNum."', '".$hosNum."', '".$dob."', 
						'".$firstName."', '".$lastName."', '".$address."', '".$gen."', '".$tableName."')";
		
			$database->query($insertQuery);
		
			// Attempt execution
