function getAddmissionTime($date, $time){
	$stamp=strtotime($date." ".$time);
	return $stamp;
}

function getDOB(){
	$date1=date_timestamp_get(date_create("1952-01-01"));
	$date2=date_timestamp_get(date_create("1989-12-31"));
	$int= rand($date1,$date2);
	$dob=date("Y-m-d",$int);
	return $dob;
}

function getWardName(){
	global $wards,$wardCount, $bedCount, $beds;
	$ward = $wards[$wardCount];
	
	if(($bedCount+1)==count($beds)){
		$wardCount++;
	}
	return $ward;
}

function getBedName(){
	global $bedCount, $beds;
	$bed = $beds[$bedCount];
	
	if(($bedCount+1)==count($beds)){
		$bedCount=0;
	}
	return $bed;
}

function getPatId($lastId){
	$length=strlen($lastId);
	$id="";
	for($j=0;$j<(9-$length);$j++){
		$id=$id."0";
	}
	$id=$id.$lastId;
	return $id;
}



